    false,nt"url": null,nt"notes": "These data present a ground-water inventory
    of existing geospatial data and other information needed to determine the extent
    and characteristics of the aquifers in the Tahoe Basin. Geospatial and other data
    include geologic maps and soil surveys of the entire basin and for specific watersheds
    within the basin at the best available scales; vegetation remote-sensing datasets;
    well information from various local, state, and federal agencies; geophysical surveys;
    and results of available ground-water studies. The compilation and development of
    a ground-water inventory geospatial database will assist the United States Forest
    Service in better assessing the present and future impacts on ground-water resources
    within the Lake Tahoe Basin.",nt"license_title": null,nt"extras": [{ntt"key":
